// src/profile/FrofileImage.js
import React from 'react';
import profileImage from '../프로필/앵무새.jpg';

const Frofile = () => {
  return (
    <div>
      <img
        src={profileImage}
        alt="Profile"
        style={{ border,radius: '80px', border: '1px solid gray' }} // 인라인 스타일 적용
      />
    </div>
    
  );
};

export default Frofile;
